const API_END_POINT = process.env.REACT_APP_API_URL || 'http://3.0.103.80:1337';

const WHITE_LABEL_URL = "/wot/whitelabelsolution?name=CUB UAT";
const PRODUCT_LIST_URL = "/productDetails";
const PRODUCT_DETAILS_URL = "/productDetails";

function template(strings, ...keys) {
    return (function (...values) {
        let dict = values[values.length - 1] || {};
        let result = [strings[0]];
        keys.forEach(function (key, i) {
            let value = Number.isInteger(key) ? values[key] : dict[key];
            result.push(value, strings[i + 1]);
        });
        return result.join('');
    });
}

export {
    API_END_POINT,
    WHITE_LABEL_URL,
    PRODUCT_LIST_URL,
    PRODUCT_DETAILS_URL
}
